#include <string>
#include <cmath>

class Solution {
public:
    long long numberOfPowerfulInt(long long start, long long finish, int limit, std::string s) {
        long long count = 0;
        long long suffix = std::stoll(s);
        if (suffix > finish) return 0; // Suffix is larger than finish, return 0

        int sLength = s.length();
        long long minVal = std::pow(10, sLength - 1);
        if (suffix < minVal) return 0; // Suffix is not a valid number, return 0

        // Calculate the minimum and maximum prefix values
        long long minPrefix = start / minVal;
        long long maxPrefix = finish / minVal;

        // Adjust the range of start and finish to include the suffix
        start = std::max(start, suffix);
        finish = std::min(finish, suffix + minVal * (limit + 1) - 1);

        // Loop through all possible prefixes
        for (long long prefix = 0; prefix <= limit; ++prefix) {
            long long current = prefix * minVal + suffix;
            if (current >= start && current <= finish) {
                ++count;
            }
        }

        return count;
    }
};
